import React from 'react'
import { Card } from "./Card";
import RouteCreate from '../images/RouteCreate.png'
import Routeimg from '../images/Routeimg.png'
import RouteMap from '../images/RouteMap.png'

export  function Cards() {

    const cards = [
        {
            id: 1,
            title: "My Routes",
            Image: Routeimg,
        },
        {
            id: 2,
            title: "Create Route",
            Image: RouteCreate,
        },
        {
            id: 3,
            title: "Map",
            Image: RouteMap,
        }
    ]

  return (
    <div>
        <div className='row' >
            {cards.map(card => (
                <div className='col-sm-4' key={card.id}>
                    <Card title={card.title} Image={card.Image} />
                    </div>
                    ))
            }       
    </div>
    </div>
    )
}
